import React from 'react';
import Navbar from './components/layout/Navbar'
import Footer from './components/layout/Footer';
import Form from './components/contact/Form';

function App() {
  return (
      <div className="App">
        <Navbar />
        <p>Coming soon!</p>
        <Form />
        <p></p>
        <footer><Footer /></footer>
      </div>
  );
}

export default App;
